column8:
1)Нормативное закрепление обязанности оформления товаросопроводительного документа на партию зерна и (или) партию продуктов переработки зерна юридическими лицами и индивидуальными предпринимателями;
2) С учетом реализации цели № 1, исключить оборот зерна или продуктов переработки зерна, не отвечающего требования законодательства Российской Федерации в сфере контроля качества зерна и продуктов переработки зерна, а также требованиями аналогичной сферы законодательства зарубежных стран;
3) Введение в Российской Федерации результативной и централизованной системы прослеживаемости зерна и продуктов переработки  
4) Установление сроков оформления товаросопроводительного документа на партию зерна и (или) партию продуктов переработки зерна 
5)  Установление формы товаросопроводительного документа на партию зерна и (или) партию продуктов переработки зерна

