column5:
Совершение действий для привлечения иностранных граждан к трудовой деятельности (в электронном виде): 
регистрация в информационно-аналитической системе Общероссийская база вакансий «Работа в России», на Едином портале государственных и муниципальных услуг (функций);
размещение вакансий в информационно-аналитической системе Общероссийская база вакансий «Работа в России»;
подача уведомлений о заключении или расторжении трудового договора, гражданско-правового договора на выполнение работ (оказание услуг) с иностранным гражданином.

column2:
Возникновение 
1) обязательств исполнителя государственного контракта на разработку НИОКТР по представлению информации государственным заказчикам для внесения информации в Единый реестр; 
2) обязательств возможных приобретателей у исполнителя государственного контракта на разработку НИОКТР исключительных прав; 
3) обязательств по включению в государственные контракты и договоры с исполнителями положений порядка ведения, предусматривающих обязательства исполнителей.

Количественной оценке не поддается.

column5:
Владельцы сайтов в сети "Интернет", страниц сайтов в сети "Интернет", информационных систем, программ для электронных вычислительных машин, используемых для распространения продукции средств массовой информации, зарегистрированных в соответствии с Законом Российской Федерации от 27 декабря 1991 года № 2124-1 "О средствах массовой информации", аудиовизуальных произведений и иной распространяемой на государственном языке Российской Федерации, государственных языках республик в составе Российской Федерации или иных языках народов Российской Федерации общедоступной информации в сети "Интернет" (далее – владельцы сайтов в сети «Интернет»), включенных в реестр информационных ресурсов, объем аудитории которых подлежит исследованию, предоставляют  уполномоченной организации по исследованию объема аудитории: 
1) данные, необходимые для определения объема аудитории информационных ресурсов, объем аудитории которых подлежит исследованию;
2) данные, необходимые для определения объема аудитории продукции средств массовой информации, зарегистрированных в соответствии с Законом Российской Федерации от 27 декабря 1991 года № 2124-1 «О средствах массовой информации», аудиовизуальных произведений и иной общедоступной информации.
